static float * p_layer_3_bias = layer_3_bias;
    
static float sigmoid(float num) {
    return 1 / (1 + exp(-num));
}

static float step(float num) {
    if (num < 0) {
        return 0;
    }
    return 1;
}

static float relu(float num) {
    if (num > 0) {
        return num;
    } else {
        return 0;
    }
}

static float linear(float num) {
    return num;
}

static void layer(const float * in, const float * layer_weight, const float * layer_bias,   
            int row, int col, float * output, int use_activation) {
    int ii;
    int jj;
    const float * p;

    for(ii = 0; ii < col; ii++) {
        p = layer_weight + ii;
        output[ii] = 0;
        for (jj = 0; jj < row; jj++) {
            output[ii] += in[jj] * (*p); 
            p += col;
        }
        output[ii] += layer_bias[ii];
        
        if (use_activation == 1) {
			output[ii] = relu(output[ii]);
        }
    }
}

const float* nn_rho_2(const float* input) {
	layer(input, p_layer_0_weight, p_layer_0_bias, STRUCTURE[0][0], STRUCTURE[0][1], output_0, 1);
	layer(output_0, p_layer_1_weight, p_layer_1_bias, STRUCTURE[1][0], STRUCTURE[1][1], output_1, 1);
	layer(output_1, p_layer_2_weight, p_layer_2_bias, STRUCTURE[2][0], STRUCTURE[2][1], output_2, 1);
	layer(output_2, p_layer_3_weight, p_layer_3_bias, STRUCTURE[3][0], STRUCTURE[3][1], output_3, 0);

	return output_3;
}
